INSERT INTO `homes` VALUES (1,'#2BB 강남구 Room(다인실)',2,'메인코스 수강생에게 제공되는 WeWork 이용권으로 3개월 동안 24시간 WeWork를 이용하실 수 있습니다. 생맥주, TERAROSA(테라로사), 커피, 우유, 두유가 무제한으로 제공되고 암벽등반, 탁구, 북클럽, 요가 클래스 등 다양한 이벤트가 있는 위워크에서 동기들과 함께 강남의 테헤란로 중심부에서 개발자의 커리어를 멋지게 시작하세요.\n','강남구,서울,한국',37.492230,127.077133,2,4,1),(2,'#코로나대비#완전방역#강남구 도보5분거리#행복숙박',0,'창조적인 animation과 css를 좋아하고 무엇이든 구현할 수 있다고 믿는 프론트엔드 개발자. 아름다운 UI를 구현하는 것을 좋아한다. 해외에서 다양한 문화를 겪으면서 키운 커뮤니케이션 스킬을 바탕으로 같이 즐겁게 일하고 싶은 개발자가 되기 위해 노력한다. 끊임없는 배움은 개발자의 숙명이라 생각하고 지식을 넓혀가는 것에 즐거움을 느낀다.\n','강남구,서울,한국',37.504660,127.038682,2,1,1),(3,'[NEW]강남구 / 1.5룸 / 아늑하고 예쁜 집',4,'미국에서 10년동안 Software Engineer 그리고 Director of Engineering으로 일했다. 뉴욕 월가에서 장외주식거래 시스템을 개발하였고 또한 1초에 백만개 이상의 트랜잭션(transaction)을 처리하는 고성능 실시간 분산 시스템도 개발하였다. 출간한 저서로는 \'깔끔한 파이썬 탄탄한 백엔드\' 이 있다. 2015년에 한국에 귀국해서 2개의 핀테크 스타트업을 공동창업 하여 로보어드바이저 시스템 부터 주식 공매도 데이터 분석 플랫폼(platform)등 다양한 핀테크 시스템을 개발하였다. 이런 다양한 경험과 지식을 바탕으로 위코드를 설립하여 후배 개발자 양성에 힘쓰고 있다. 또한 최근에는 서울 글로벌 창업 센터의 technical mentor로 임명되어 다양한 분야의 기업들에게 기술적 조언을 주고있다.\n\n','강남구,서울,한국',37.502564,127.052939,10,4,1),(4,'★Home Camping in seoul/강남구 위치/ 방역,소독진행중',3,'지식과 기술의 본질을 소중히 여기는 프론트엔드 개발자. 기록하고 소통하는 것을 좋아하며 수강생들이 더 나은 실력과 심력을 갖춘 개발자로 성장할 수 있도록 노력한다. 교육을 전공했으며 더 나은 교육 서비스와 콘텐츠를 직접 개발하여 사람들의 진로에 좋은 영향을 주고자 웹 개발을 시작하게 되었다. 새로운 것을 기획하고 생산하는 웹 개발에 더욱 매력을 느끼며 Web Technology 분야의 다방면으로 부지런히 관심사를 확장 시키는 중이다.\n','강남구,서울,한국',37.510446,127.033949,15,1,1),(5,'!!배그!! 롤!!겜캉스2탄 강남구 pc숙소/최고사양 커플PC',1,'Infrastructure, DevOps 및 자동화에 관심이 많은 위코드 백엔드 소프트웨어 엔지니어이자, 멘토이다. 이전에는 시스템 엔지니어 및 클라우드 엔지니어로 근무 했으며, 시스템 엔지니어 업무 및 클라우드 운영, JAVA 기반의 서버 기능 개발 및 Python을 활용한 자산관리 시스템 등을 개발에 참여했었다.\n','강남구,서울,한국',37.481866,127.058166,12,3,1),(6,'#0좋은 집 전체 코로나 걱정마세요 강동구,리조트 corona Don\'t worry',4,'지식과 기술의 본질을 소중히 여기는 프론트엔드 개발자. 기록하고 소통하는 것을 좋아하며 수강생들이 더 나은 실력과 심력을 갖춘 개발자로 성장할 수 있도록 노력한다. 교육을 전공했으며 더 나은 교육 서비스와 콘텐츠를 직접 개발하여 사람들의 진로에 좋은 영향을 주고자 웹 개발을 시작하게 되었다. 새로운 것을 기획하고 생산하는 웹 개발에 더욱 매력을 느끼며 Web Technology 분야의 다방면으로 부지런히 관심사를 확장 시키는 중이다.\n','강동구,서울,한국',37.539517,127.147360,9,1,2),(